import logo from './logo.svg';
import './App.css';

let name = "Himanshu";
function App() {
  return (
    <>
      <div className="blank">
        Niceee
      </div>
      <h2>hello {name}</h2>
      <nav>
        <li>Home</li>
        <li>Service</li>
        <li>Contact</li>
      </nav>

    </>
  );
}

export default App;
